import React from "react";
import { getTemperaments } from "../../Redux/actions";

export default function RecipeCard({title, image, temperaments}){
    return (
        <div>
            <h1>{title}</h1>
            <img src={image} alt="img not found" width="250px" height="190px"/>
            {temperaments.map((el, index) => (
            <h5 key= {index}>{el}</h5>

            ))}
        </div>
        );
    }
